import React from "react";
import Head from "next/head";
import Header from "../components/Header";
import { Row, Col } from "antd";

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel="icon" href="/favicon.ico" />
    </Head>
    <Header />

    <Row className="common-main">
      <Col className="common-left" xs={24} sm={24} md={16} lg={18} xl={14}>左边</Col>
      <Col className="common-right" xs={0} sm={0} md={7} lg={5} xl={4}>右边</Col>
    </Row>
  </div>
);

export default Home;
